import React from 'react';
import {Nav, Navbar,Form,FormControl,Button} from 'react-bootstrap';
import { FiBookmark } from 'react-icons/fi'
import styled from 'styled-components';
import {Switch} from 'react-bootstrap-switch';


const Styles = styled.div`
    // .navbar {
    //     background-color: #222;
    // }

    // .navbar-brand, .navbar-nav .nav-link {
    //     color: #bbb;
    //     &:hover {
    //         color:white;
    //     }
    // }

    // .ml-auto {
    //     position:fixed;
    //     left:0;
    // }
`;

const handleSwitch = () => {
    return null;
}

// a functional component returns a react element
export const NavigationBar = () => (
    <Styles>
        <Navbar classname="navbar" collapseOnSelect bg="primary" variant="dark" fixed="top" expand="sm">
            <Form inline>
                    <FormControl type="text" placeholder="Enter keyword" className="input-search" />
                    {/* <Button type="submit">Submit</Button> */}
            </Form>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" className="justify-content-center"/>
            <Navbar.Collapse id='responsive-navbar-nav'>
                <Nav className='justify-content-center'>  {/* ml-auto  */}
                    <Nav.Item className="justify-content-center"><Nav.Link href="/">Home</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href="/world">World</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href="/politics">Politics</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href="/business">Business</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href="/technology">Technology</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href="/sports">Sports</Nav.Link></Nav.Item>
                </Nav>
                <Nav className='justify-content-end'>
                    <Nav.Item><Nav.Link href="#"> <FiBookmark /> </Nav.Link></Nav.Item>
                    <Navbar.Text>NYTimes</Navbar.Text>
                    <Nav.Item>
                         <div className='custom-control custom-switch'>
                         <input type='checkbox' className='custom-control-input' id='customSwitches' readOnly />
                        <label className='custom-control-label' htmlFor='customSwitches'>
                        {/* Toggle this switch element */}
                        </label>
                    </div>
                    {/* <Switch /> */}
                    </Nav.Item>

                    <Navbar.Text>Guardian</Navbar.Text>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    </Styles>
)
